import React from 'react';

export default function Hero2() {
  return (
    <div className="bg-gray-200">
      <div className="flex flex-col items-center justify-center py-10 mx-10">
        <div className="mb-10 font-serif font-semibold">AS FEATURED ON...</div>
        <div className="w-full border border-black ">
          <div className="flex items-center justify-center">
            <div className="font-serif font-bold text-transparent mt-14 text-9xl bg-clip-text bg-gradient-to-br from-orange-400 via-rose-900 to-blue-500">
              *
            </div>
            <div className="text-5xl font-semibold ">CSS-TRICKS</div>
          </div>
        </div>
      </div>
    </div>
  );
}
